import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import { ReactComponent as JavaIcon } from './icons/java.svg';
import { ReactComponent as PythonIcon } from './icons/python.svg';
import { SvgIcon, Box } from '@material-ui/core';
import styles from './Skills.module.css'



function generate(element) {
  return [0, 1, 2].map((value) =>
    React.cloneElement(element, {
      key: value,
    }),
  );
}

export default function Skills() {
//   const classes = useStyles();

  return (
    <div>
      <Grid container spacing={1}>
        <Box boxShadow={1} className={styles.header} fontWeight="bold" display="flex" alignItems="center">
        <Typography variant="h6" >
            Skills
          </Typography>
        <Grid item xs={6} md={6}>
          <div >
            <List>
                <ListItem>
                  <ListItemIcon>
                    <SvgIcon component={JavaIcon} viewBox="0 0 48 48"/>
                  </ListItemIcon>
                  <ListItemText primary="Java"/>
                </ListItem>
                <ListItem>
                  <ListItemIcon>
                    <SvgIcon component={PythonIcon} viewBox="0 0 48 48"/>
                  </ListItemIcon>
                  <ListItemText primary="Python"/>
                </ListItem>
            </List>
          </div>
        </Grid>
        </Box>
      </Grid>

    </div>
  );
}
